-- Write a query to fetch total salary of the employee based on the Departments
select Dept_ID,sum(Salary) as total_salary
from EmployeeInfo
group by Dept_ID

--to get dept name 
select E.Dept_ID,D.Dept_Name,sum(E.Salary) total_salary
from EmployeeInfo E
join Departments D on E.Dept_ID =D.Dept_ID
group by E.Dept_ID,D.Dept_Name

------------------------------------------------------------------------------------------------------------------
--Write a query to fetch the above 5 years of experience employees

--step 1 : displaying the experience of all emps
select Employee_Name,DATEDIFF(year,Hire_Date,GETDATE()) as experience
from EmployeeInfo

--step 2: display emps having >5years exp
select Employee_Name,DATEDIFF(year,Hire_Date,GETDATE()) as experience
from EmployeeInfo
where DATEDIFF(year,Hire_Date,GETDATE())>5

